  <p style={{ paddingLeft: "5pt", textIndent: "0pt", textAlign: "justify" }}>
    1.8 <span className="s17">m</span>m (2.1 150 mm) column (Waters) maintained
    at 50<span className="s14">8</span>C. A mobile phase gradient from 87% A and
    13% B to 5% A and 95% B was used with a 10 <span className="s17">m</span>L
    sample volume, a 400 <span className="s17">m</span>L ﬂow rate per minute and
    a total analytical run time of 15 min. MS conditions
  </p>
